import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { incidentService } from '../services/api';
import './MyIncidents.css';

const MyIncidents = () => {
  const navigate = useNavigate();
  const [incidents, setIncidents] = useState([]);
  const [searchQuery, setSearchQuery] = useState('');
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    fetchIncidents();
  }, []);

  const fetchIncidents = async () => {
    try {
      const response = await incidentService.getAllIncidents();
      setIncidents(response.data);
      setLoading(false);
    } catch (err) {
      setError('Failed to fetch incidents');
      setLoading(false);
    }
  };

  const handleBack = () => {
    navigate('/home');
  };

  const getIncidentIcon = (type) => {
    switch (type.toLowerCase()) {
      case 'explosives/weapons':
        return '💣';
      case 'theft':
        return '🕵️';
      case 'others':
        return '📦';
      case 'fraud':
        return '💰';
      case 'domestic violence':
        return '🏠';
      default:
        return '❓';
    }
  };

  const formatDate = (dateString) => {
    const date = new Date(dateString);
    const year = date.getFullYear();
    const month = String(date.getMonth() + 1).padStart(2, '0');
    const day = String(date.getDate()).padStart(2, '0');
    
    // Add B.S. date conversion logic here if needed
    return `${year}-${month}-${day} (2081-10-23 B.S)`;
  };

  const getStatusColor = (status) => {
    switch (status.toLowerCase()) {
      case 'acknowledged':
        return 'green';
      case 'rejected':
        return 'red';
      case 'pending':
        return 'orange';
      default:
        return 'gray';
    }
  };

  const filteredIncidents = incidents.filter(incident =>
    incident.type.toLowerCase().includes(searchQuery.toLowerCase())
  );

  return (
    <div className="my-incidents-container">
      <div className="incidents-header">
        <button className="back-button" onClick={handleBack}>
          <svg width="24" height="24" viewBox="0 0 24 24">
            <path d="M20 11H7.83l5.59-5.59L12 4l-8 8 8 8 1.41-1.41L7.83 13H20v-2z" fill="white"/>
          </svg>
        </button>
        <h1>My Incidents</h1>
        <button className="filter-button">
          <svg width="24" height="24" viewBox="0 0 24 24">
            <path d="M3 17v2h6v-2H3zM3 5v2h10V5H3zm10 16v-2h8v-2h-8v-2h-2v6h2zM7 9v2H3v2h4v2h2V9H7zm14 4v-2H11v2h10zm-6-4h2V7h4V5h-4V3h-2v6z" fill="white"/>
          </svg>
        </button>
      </div>

      <div className="search-container">
        <input
          type="text"
          placeholder="Search"
          value={searchQuery}
          onChange={(e) => setSearchQuery(e.target.value)}
          className="search-input"
        />
      </div>

      {loading ? (
        <div className="loading">Loading incidents...</div>
      ) : error ? (
        <div className="error">{error}</div>
      ) : (
        <div className="incidents-list">
          {filteredIncidents.map((incident) => (
            <div key={incident._id} className="incident-card">
              <div className="incident-icon">
                {getIncidentIcon(incident.type)}
              </div>
              <div className="incident-details">
                <h3>{incident.type}</h3>
                <div className="incident-info">
                  <p className="incident-id">
                    <strong>Incident Id</strong><br />
                    {incident._id}
                  </p>
                  <p className="reported-date">
                    <strong>Reported Date</strong><br />
                    {formatDate(incident.createdAt)}
                  </p>
                  <p className="status" style={{ color: getStatusColor(incident.status) }}>
                    <strong>Status</strong><br />
                    {incident.status}
                  </p>
                </div>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default MyIncidents;
